pre_proc_tweet:
we watched the movie "soul surfer" last night (the bethany hamilton story, if you have not seen it) and it was fabulous. what makes bethany's story inspiring is her determination to get right back to living life after she lost her arm very traumatically to a shark bite. it would be a devastating injury to anyone but to someone who is so athletic and had a bright future career as a professional surfer, it was not only devastating but threatened her very identity. 
often after loss, trauma, or tragedy, we have to reform our concept of who we are. after i left home at 19, i wanted to be a strong survivor, not an abuse victim. i didn't realize at that time that shutting out pain from the past gave it power over me instead of giving me power over it. to truly heal, we have to embrace what happens to us in life and accept that it will influence us. only then, do we have a choice in how it influences us. life hus and bad things happen but our scars from life's wounds make us stronger when we learn to be grateful for them. 
for more on issues like this and other topics on reaching your potential in life and leadership, join me on my podcast "fearfully and wonderfully me." subscribe from your podcast channel of choice or listen here:

